import React from "react";
import { useState } from "react";

const courses = [
  {
    id: 1,
    name: "html",
  },
  {
    id: 2,
    name: "css",
  },
  {
    id: 3,
    name: "js",
  },
];

const CheckboxForm = () => {
  return (
    <div>
      <input type="checkbox" />
    </div>
  );
};

export default CheckboxForm;
